import React, { useState, useEffect } from "react";
import Navbar from "./Navbar";
import "./Apartaments.css";
import flat from "../images/flat.jpg";
import axios from "axios";
import Footer from "./Footer";
import { library } from "@fortawesome/fontawesome-svg-core";
import { faHeart, faCoffee } from "@fortawesome/free-solid-svg-icons";
import { Beverage } from "./Beverage";
import { faHeart as faRegularHeart } from "@fortawesome/free-regular-svg-icons";

const Aparaments = () => {
  const [apartaments, setApartaments] = useState([]);

  library.add(faHeart, faCoffee, faRegularHeart);

  const getApartaments = () => {
    const config = {
      headers: {
        "Content-Type": "application/json",
      },
    };

    axios
      .get("http://127.0.0.1:8000/apartament", config)
      .then(function (response) {
        // handle success
        setApartaments(response.data.apartaments);
        console.log(response.data.apartaments);
      })
      .catch(function (error) {
        // handle error
        console.log(error);
      })
      .then(function () {
        // always executed
      });
  };
  // getApartaments();
  // apartaments.map((apartament) => {});
  useEffect(() => {
    // getApartaments();
    console.log("TTT", apartaments);
  });

  useEffect(() => {
    getApartaments();
  }, []);
  return (
    <div className="container">
      <Navbar></Navbar>
      <div className="apartaments_list">
        {apartaments.map((apartament) => {
          return (
            <div className="apartament">
              <img src={flat} alt="Logo" className="apartament_photo" />
              <div className="apartament_info">
                <h2>{apartament.description} </h2>
                <h3>Dzielnica: {apartament.place}</h3>
                <h3>Cena: {apartament.price} </h3>
                <h3>Cena za metr: {apartament.price_per_m}</h3>
                <h3>Powierzchnia: {apartament.area}</h3>
                <h3>Portal: {apartament.source}</h3>
                <FontAwesomeIcon icon="heart" color="#b6b6b6" size="2x" />
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Aparaments;
